import React from 'react';
import logo from '../../../Img/Logo.png';

const Auth = () => {
    return (
        <div className={'auth__wrapper'}>
            <section className={'auth__container'}>
                <img src={logo} alt={'Logo'}/>

                
            </section>
        </div>
    );
};

export default Auth;
